```
var card = CardFactory.adaptiveCard({
    "type": "AdaptiveCard",
    "body": [
        {
            "type": "TextBlock",
            "text": "Hello World",
            "size": "Medium",
            "weight": "Bolder",
            "color": "White",
            "bgcolor": "Red"
        }
    ]
