1. **Create a new directory** for your extension and navigate into it.

2. **Create a manifest file**: Create a new file named `manifest.json` and add the following content:

```json
{
  "manifest_version": 2,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "description": "Takes a screenshot of the current webpage and saves it locally.",
  "permissions": ["activeTab", "fileSystem", "downloads"],
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  }
}
```

3. **Create a popup**: Create a new file named `popup.html` and add the following content:

```html
<!DOCTYPE html>
<html>
  <head>
    <script src="popup.js"></script>
    <style>
      button {
        margin: 10px;
      }
    </style>
  </head>
  <body>
    <h1>Webpage Screenshot</h1>
    <button id="capture">Capture Screenshot</button>
  </body>
</html>
```

4. **Add functionality to the popup**: Create a new file named `popup.js` and add the following content:

```javascript
document.getElementById('capture').addEventListener('click', () => {
  chrome.tabs.query({ active: true, currentWindow: true }, (tabs) => {
    chrome.tabs.captureVisibleTab(null, {}, (imageUrl) => {
      chrome.fileSystem.chooseEntry({ type: 'saveFile' }, (writeFileEntry) => {
        if (writeFileEntry) {
          writeFileEntry.createWriter((writer) => {
            writer.onwriteend = () => {
              console.log('Screenshot saved successfully!');
            };
            writer.onerror = (error) => {
              console.error('Error saving screenshot:', error);
            };
            writer.write(new Blob([imageUrl], { type: 'image/png' }));
          });
        } else {
          console.log('User cancelled the save operation');
        }
      });
    });
  });
});
```

